package application.model;

public class Casello {

	String nome;
	int km;
	String citta;

	public Casello() {
		// TODO Auto-generated constructor stub
	}

	public String getNome() {
		return this.nome;
	}
	public String setNome(String n) {
		return this.nome=n;
	}
	public int getKm() {
		return this.km;
	}
	public int setKm(int n) {
		return this.km=n;
	}
	public String getCitta() {
		return this.citta;
	}
	public String setCitta(String n) {
		return this.citta=n;
	}
}
